window.bookSummaryJSON = "<p>A love story worth fighting for.***It was one <a href=\"http://punch.one/\">punch.</a></p> <p><a href=\"http://punch.one/\">One</a> ruthless punch that changed Declan's life forever. Alexis is granted a dream of a new normal whether she wants it or not, when unbeknownst to her, she's named the sole executor of her best friend's Last Will. Fortuned a new house in a random town named, Paisley, a hefty bank account, and her friend's last written words, it's almost like she was supposed to be there. This green-eyed choreographer begins to try and step forward, to her own beat this time, without the short chains she has always known.***But once she gets lost in her new neck of the woods, Alexis finds herself in the warm hands of broody sexy man, Declan \"Irish\" McQuade, a former underground fighter who heats her up no problem. And she can't risk anymore problems.Boxing life and a Nightclub co-owner along with his two best friends, Declan isn't the kind of guy who does serious relationships, but he also isn't the type of guy who is going to leave this new girl in town out in the cold. He does possess some manners.However, sometimes we can't shake the filth from our past. Declan's focus shifts when his former rival enemy returns to Paisley. As he prepares himself for a grudge match, it turns out, it may not be the fight he could have prepared for.Can Declan keep himself under control to protect the ones he loves in this round of his life?</p> <p>Will Alexis find her happiness and contentment in her new normal?</p> <p>Together they swirl through fires and fights, from their past to their present, trying to hold on for the possibility of a future.Dual POV Romantic Suspense**HEA **Steamy Romance**Contemporary Romance **Sports Romance** Romantic Suspense*** Women's Fiction ** Literature and Fiction ***Can be read as a stand-a-loneWARNING: MATURE THEMES, Trigger warning, MA for Sexual Content/SPICEMeagan Elizabeth is the sole writer, editor, and publisher who found two amazing voices to n- support the little guys - and much thanks for those who do.</p>"; 
